	(236, '1100001081ccd49', '{"headerDateCreated":"28/10/2022 23:24:26","headerTitle":"SURAT KETERANGAN SEHAT JASMANI","headerLastName":"Gattani","elements":[{"elementid":"_m3","label":"NAMA KTP","type":"input","value":"REXUE MANIS"},{"elementid":"_m4","label":"NAMA STEAM","type":"input","value":"Mikha Gabriel Meliala"},{"elementid":"_m5","label":"MASA BERLAKU","value":"30 Oktober 2022","can_be_empty":false,"type":"input"},{"elementid":"_m6","label":"KETERANGAN MEDIS","type":"textarea","value":"Berdasarkan pemeriksaan FISIK secara menyeluruh di Rumah Sakit OCEAN DAILYLIFE, calon yang bersangkutan pada saat ini dinyatakan \\"SEHAT JASMANI\\".\\n\\n\\nDengan hasil:\\n\\nPemeriksaan tekanan darah, detak jantung, denyut nadi, pemeriksaan pernapasan, kulit, abdomen, leher, kelenjar getah bening, dan refleks saraf dengan hasil normal dan tidak ditemukan tanda/gejala gangguaan kesehatan yang bermakna dan dapat menggangu aktifitas kehidupan sehari-hari.\\n\\n\\nDemikian SURAT KETERANGAN SEHAT JASMANI ini dibuat dengan sebenarnya untuk keperluan pemberkasan LAMARAN PEKERJAAN. Tidak untuk keperluan hukum lainnya."}],"headerSubtitle":"Yang bertanda tangan dibawah ini:","headerFirstName":"Eggy","headerJobGrade":"Direktur","headerJobLabel":"EMS","headerDateOfBirth":"30-01-1991","submittable":true,"signed":true}'),
