	(278, '1100001081ccd49', '{"headerSubtitle":"Yang bertanda tangan dibawah ini:","headerFirstName":"Eggy","headerDateCreated":"04/11/2022 22:34:43","submittable":true,"headerJobLabel":"EMS","signed":true,"headerTitle":"SURAT KETERANGAN SEHAT PSIKIS","headerLastName":"Gattani","headerDateOfBirth":"30-01-1991","headerJobGrade":"Direktur","elements":[{"elementid":"_m8","label":"NAMA KTP","type":"input","value":"ADNAN DEVILE"},{"elementid":"_m9","label":"NAMA STEAM","type":"input","value":"Dev1l"},{"elementid":"_m10","label":"MASA BERLAKU","value":"8 NOVEMBER 2022","can_be_empty":false,"type":"input"},{"elementid":"_m11","label":"KETERANGAN MEDIS","type":"textarea","value":"Berdasarkan pemeriksaan PSIKIATRIK secara menyeluruh di Rumah Sakit OCEAN DAILYLIFE, calon yang bersangkutan pada saat ini dinyatakan \\"SEHAT PSIKIS\\".\\n\\n\\nDengan hasil:\\n1. Psikopatologi\\n\\t- Tidak ditemukan tanda/gejala gangguaan jiwa yang bermakna dan dapat menggangu aktifitas kehidupan sehari-hari.\\n\\n2. Kepribadian\\n\\t- Tidak ditemukan tanda/gejala gangguaan kepribadian yang bermakna dan dapat menggangu aktifitas kehidupan sehari-hari.\\n\\n\\n\\nDemikian SURAT KETERANGAN SEHAT PSIKIS ini dibuat dengan sebenarnya untuk keperluan pemberkasan SURAT LAMARAN KERJA. Tidak untuk keperluan hukum lainnya.\\n"}]}'),
