	(417, '11000013e9361f2', '{"headerTitle":"SURAT KETERANGAN SEHAT JASMANI","elements":[{"value":"ALAN RUDY","elementid":"_m13","type":"input","label":"NAMA KTP"},{"value":"ALAN RUDY","elementid":"_m14","type":"input","label":"NAMA STEAM"},{"type":"input","elementid":"_m15","value":"14 NOVEMBER 2022","can_be_empty":false,"label":"MASA BERLAKU"},{"value":"Pemeriksaan tekanan darah, detak jantung, denyut nadi, pemeriksaan pernapasan, kulit, abdomen, leher, kelenjar getah bening, dan refleks saraf dengan hasil normal dan tidak ditemukan tanda/gejala gangguaan kesehatan yang bermakna dan dapat menggangu aktifitas kehidupan sehari-hari.\\n\\nDemikian SURAT KETERANGAN SEHAT JASMANI ini dibuat dengan sebenarnya untuk keperluan pemberkasan melamar kerja. Tidak untuk keperluan hukum lainnya.","elementid":"_m16","type":"textarea","label":"KETERANGAN MEDIS"}],"signed":true,"headerLastName":"Pendou","headerDateOfBirth":"05-07-1995","headerJobGrade":"Co. Ass","headerSubtitle":"Yang bertanda tangan dibawah ini:","headerFirstName":"Hutu","headerJobLabel":"EMS","headerDateCreated":"11/11/2022 16:23:20","submittable":true}'),
