	(754, '1100001439e850f', '{"headerDateOfBirth":"2003/07/11","submittable":true,"headerLastName":"Smith","headerJobGrade":"Direktur","headerDateCreated":"23/11/2022 22:0:25","headerFirstName":"Jakson","headerTitle":"SURAT KETERANGAN/IZIN DARI RUMAH SAKIT","headerSubtitle":"Yang bertanda tangan dibawah ini:","signed":true,"headerJobLabel":"EMS","elements":[{"type":"input","label":"NAMA KTP","elementid":"_m4","value":"MECKO GUILLERMO"},{"type":"input","label":"NAMA STEAM","elementid":"_m5","value":"MRCATZ"},{"type":"input","can_be_empty":false,"value":"23 NOVEMBER -25 NOVEMBER 2022","elementid":"_m6","label":"MASA BERLAKU"},{"type":"textarea","label":"KETERANGAN MEDIS","elementid":"_m7","value":"Nama                      : MECKO GUILLERMO\\nPekerjaan                 : Penambang\\nUmur                      : 22\\nNo. HP                    : -\\nDokter yang menangani     : dr. Jakson Smith dan Jelly Hwang\\nDiagnosa                  : Mengalami luka Tembak di kiri sedalam 5cm\\nKeterangan                : \\n\\n!Ruang Operasi!\\nPetugas operasi mencuci tangan, memakai sarung tangan baru dan menyiapkan alat operasi, korban di pasangkan infus pada lengan, lalu di bius lokal, lalu melepas perban lama, membersihkan luka menggunakan alkohol dan kapas, kemudian mensayat pada bagian kulit dengan pisau kemudian di beri pinset sebanyak 2 buah di area kulit dan mensayat area daging kemudian diberi pinset 2 buah lagi di area daging. lalu mencabut peluru yang bersarang di pelipis kiri kemudian mencabut 2 pinset area daging lalu di jahit menggunakan benang type 1 sebanyak 5 jahitan kemudian mencabut 2 pinset pada kulit kemudian di jahit sebanyak 5 jahitan, lalu diberikan ibuprofin dan anti septik , kemudian membersihkan sisa darah di bagian wajah, dan melilit perban di bagian kepala kemudian mengecek apakah posisi balutan perban tepat melindungi luka jahitan kemudian di beri anti bius, lalu melepas infus ditangan dan dirawat inap di kelas VIP"}]}'),
