	(824, '1100001439e850f', '{"headerJobGrade":"Direktur","signed":true,"headerFirstName":"Jakson","headerJobLabel":"EMS","headerDateCreated":"26/11/2022 23:22:39","submittable":true,"headerLastName":"Smith","headerSubtitle":"Yang bertanda tangan dibawah ini:","headerDateOfBirth":"2003/07/11","elements":[{"label":"NAMA KTP","elementid":"_m0","type":"input","value":"ICAL BAKUGO"},{"label":"NAMA STEAM","elementid":"_m1","type":"input","value":"suja"},{"can_be_empty":false,"label":"MASA BERLAKU","value":"26 NOVEMBER - 29 NOVEMBER 2022","type":"input","elementid":"_m2"},{"label":"KETERANGAN MEDIS","elementid":"_m3","type":"textarea","value":"Nama                      : ICAL BAKUGO\\nPekerjaan                 : PENAMBANG\\nUmur                      : 22\\nDokter yang menangani     : JAKSON SMITH\\nDiagnosa                  : Mengalami luka Tembak di Pelipis kanan sedalam 5cm\\nKeterangan                : \\n!Ruang Operasi!\\nPetugas operasi mencuci tangan, memakai sarung tangan baru dan menyiapkan alat operasi, korban di pasangkan infus pada lengan, lalu di bius lokal, lalu melepas perban lama, membersihkan luka menggunakan alkohol dan kapas, kemudian mensayat pada bagian kulit dengan pisau kemudian di beri pinset sebanyak 2 buah di area kulit dan mensayat area daging kemudian diberi pinset 2 buah lagi di area daging. lalu mencabut peluru yang bersarang di pelipis kanan kemudian mencabut 2 pinset area daging lalu di jahit menggunakan benang type 1 sebanyak 5 jahitan kemudian mencabut 2 pinset pada kulit kemudian di jahit sebanyak 5 jahitan, lalu diberikan ibuprofin dan anti septik , kemudian membersihkan sisa darah di bagian wajah, dan melilit perban di bagian kepala kemudian mengecek apakah posisi balutan perban tepat melindungi luka jahitan kemudian di beri anti bius, lalu melepas infus ditangan dan dirawat inap di kelas EKONOMI"}],"headerTitle":"SURAT KETERANGAN/IZIN DARI RUMAH SAKIT"}'),
	(825, '1100001439e850f', '{"headerJobGrade":"Direktur","signed":true,"headerFirstName":"Jakson","headerJobLabel":"EMS","headerDateCreated":"26/11/2022 23:49:41","submittable":true,"headerLastName":"Smith","headerSubtitle":"Yang bertanda tangan dibawah ini:","headerDateOfBirth":"2003/07/11","elements":[{"label":"NAMA KTP","elementid":"_m4","type":"input","value":"JACKYY DBOREN"},{"label":"NAMA STEAM","elementid":"_m5","type":"input","value":"JACKYY"},{"can_be_empty":false,"label":"MASA BERLAKU","value":"SELAMANYA","type":"input","elementid":"_m6"},{"label":"KETERANGAN MEDIS","elementid":"_m7","type":"textarea","value":"RUMAH SAKIT DAILYLIFE\\n\\nHORMAT SAYA, JAKSON SMITH\\n\\nMENYIAPKAN OBAT PENGHILANG INGATAN DENGAN DOSIS :\\n\\n- 5MG BENZODIAZEPIN\\n- 10MG ANTIKOLINERGIK\\n- 5MG ANTIPILEPSI\\n\\nTATA CARA\\n\\nMENYUNTIKAN RACIKAN OBAT MELALUI SELANG INFUS SEHINGGA DOSIS YANG MASUK KEDALAM TUBUH PASIEN PERLAHAN \\n\\nDEMIKIAN SURAT YANG SAYA BIKIN TANPA DI LEBIH DAN KURANG  KAN TERIMAKASIH."}],"headerTitle":"SURAT KETERANGAN/IZIN DARI RUMAH SAKIT"}'),
