	(1148, '11000013ca8d642', '{"headerFirstName":"Sugeng","headerJobGrade":"dr. Umum","elements":[{"label":"NAMA KTP","type":"input","elementid":"_m0","value":"SUGENG KOPLING"},{"label":"NAMA STEAM","type":"input","elementid":"_m1","value":"Allfalah"},{"label":"MASA BERLAKU","can_be_empty":false,"type":"input","elementid":"_m2","value":"7 DESEMBER 2022"},{"label":"KETERANGAN MEDIS","type":"textarea","elementid":"_m3","value":"LOS SANTOS 2022\\nKepada Yth. W.DIREKTUR - IAN KASELA\\ndi tempat\\n\\nYang bertanda tangan di bawah ini:\\nNama: SUGENG KOPLING\\nAlamat: PALETO BAY\\nJabatan: DOKTER UMUM\\n\\nMelalui surat pernyataan ini, saya berniat untuk mengajukan permohonan pengunduran diri saya dari jabatan DOKTER di perusahaan RUMAH SAKIT Terhitung mulai tanggal 7 DESEMBER 2022.\\n\\nSebelumnya, saya dengan rasa syukur yang sebesar-besarnya berterima kasih kepada Bapak/Ibu karena sudah memberikan saya kesempatan untuk dapat bekerja, belajar, dan berkembang di perusahaan Bapak/Ibu.\\n\\nSelain itu, saya juga ingin mengucapkan rasa terima kasih pada rekan-rekan kerja saya di sini yang telah berjuang bersama dalam mencapai target perusahaan.\\n\\nSaya juga mengucapkan permohonan maaf yang sebesar-besarnya karena saya tidak lagi menjadi bagian dari perusahaan Bapak/Ibu.\\n\\nSaya pun memohon maaf untuk segala kesalahan saya yang mungkin sempat meninggalkan kesan buruk di hati Bapak/Ibu. Semoga, perusahaan Bapak/Ibu dapat terus berkembang.\\n\\nDemikian surat pengunduran diri saya ini yang dibuat dengan kesadaran dan tanpa tekanan dari pihak manapun.\\n\\nHormat saya,\\n\\ntanda tangan\\n\\nSUGENG KOPLING"}],"headerDateCreated":"07/12/2022 15:49:30","headerSubtitle":"Yang bertanda tangan dibawah ini:","submittable":true,"headerTitle":"SURAT KETERANGAN DOKTER","headerLastName":"Kopling","headerDateOfBirth":"30-03-1999","signed":true,"headerJobLabel":"EMS"}'),
	(1149, '11000013ca8d642', '{"headerFirstName":"Sugeng","headerJobGrade":"dr. Umum","elements":[{"label":"NAMA KTP","type":"input","elementid":"_m8","value":"FLAVA FLAV"},{"label":"NAMA STEAM","type":"input","elementid":"_m9","value":"FLAVA FLAV"},{"label":"MASA BERLAKU","can_be_empty":false,"type":"input","elementid":"_m10","value":"7 DESEMBER 2022"},{"label":"KETERANGAN MEDIS","type":"textarea","elementid":"_m11","value":"Nama                      : FLAVA FLAV\\nPekerjaan                 : PENAMBANG\\nUmur                      : 21 Tahun\\nNo. Hp                    : -\\nDokter yang menangani     : Dr. Umum - BARON ELLIAS\\nDiagnosa                  : Mengalami Luka Bakar di Badan\\nKeterangan              :  Dilakukan pencangkokan kulit\\n\\n!Ruang Operasi!\\nPetugas operasi mencuci tangan, memakai sarung tangan  dan menyiapkan alat operasi, korban di pasangkan alat ekg, alat bantu pernafasan dan infus yang di injeksikan bius pada lengan, , lalu luka dibersihkan , dan dilakukan transplantasi kulit , setelah itu di lakukan pencangkokan kulit lama dengan kulit baru, kemudian kulit di jahit ,dan kemudian di bersihkan , setelah itu di oleskan salep luka bakar dan di pasangkan perban setelah itu disadarkan dan dibawa ke ruang rawat inap VIP."}],"headerDateCreated":"07/12/2022 16:0:55","headerSubtitle":"Yang bertanda tangan dibawah ini:","submittable":true,"headerTitle":"SURAT KETERANGAN DOKTER","headerLastName":"Kopling","headerDateOfBirth":"30-03-1999","signed":true,"headerJobLabel":"EMS"}'),
