	(1178, '110000137075d1c', '{"signed":true,"submittable":true,"headerSubtitle":"Yang bertanda tangan dibawah ini:","headerJobGrade":"dr. Umum","elements":[{"elementid":"_m4","label":"NAMA KTP","type":"input","value":"BARON ELLIAS"},{"elementid":"_m5","label":"NAMA STEAM","type":"input","value":"DOWN"},{"can_be_empty":false,"type":"input","value":"-","label":"MASA BERLAKU","elementid":"_m6"},{"elementid":"_m7","label":"KETERANGAN MEDIS","type":"textarea","value":"Kepada Yth. DIREKTUR - Jakson Smith, W,DIREKTUR - Ian Kasela\\ndi tempat,\\n\\nYang bertanda tangan di bawah ini :\\nNama: Baron Ellias\\nJabatan: DOkter Umum\\n\\nMelalui surat pernyataan ini, saya berniat untuk mengajukan permohonan pengunduran diri saya dari jabatan DOKTER di perusahaan RUMAH SAKIT Terhitung mulai tanggal 7 DESEMBER 2022.\\n\\nSebelumnya, saya dengan rasa syukur yang sebesar-besarnya berterima kasih kepada Bapak/Ibu karena sudah memberikan saya kesempatan untuk dapat bekerja, belajar, dan berkembang di perusahaan Bapak/Ibu.\\n\\nSelain itu, saya juga ingin mengucapkan rasa terima kasih pada rekan-rekan kerja saya di sini yang telah berjuang bersama dalam mencapai target perusahaan.\\n\\nSaya juga mengucapkan permohonan maaf yang sebesar-besarnya karena saya tidak lagi menjadi bagian dari perusahaan Bapak/Ibu.\\n\\nSaya pun memohon maaf untuk segala kesalahan saya yang mungkin sempat meninggalkan kesan buruk di hati Bapak/Ibu. Semoga, perusahaan Bapak/Ibu dapat terus berkembang.\\n\\nDemikian surat pengunduran diri saya ini yang dibuat dengan kesadaran dan tanpa tekanan dari pihak manapun.\\n\\nHormat saya,\\n\\ntanda tangan\\n\\nBARON ELLIAS"}],"headerLastName":"ELLIAS","headerJobLabel":"EMS","headerDateCreated":"08/12/2022 13:9:14","headerDateOfBirth":"04-01-2005","headerFirstName":"BARON","headerTitle":"SURAT KETERANGAN DOKTER"}'),
