	(1331, '110000156008649', '{"headerTitle":"SURAT KETERANGAN SEHAT JASMANI","elements":[{"elementid":"_m47","value":"VINTOR JEYSEN","label":"NAMA KTP","type":"input"},{"elementid":"_m48","value":"DIMSTGE","label":"NAMA STEAM","type":"input"},{"type":"input","label":"MASA BERLAKU","value":"12 DESEMBER - 22 DESEMBER","can_be_empty":false,"elementid":"_m49"},{"elementid":"_m50","value":"Berdasarkan pemeriksaan FISIK secara menyeluruh di Rumah Sakit DAILYLIFE, calon yang bersangkutan pada saat ini dinyatakan \\"SEHAT JASMANI\\".\\n\\n\\nDengan hasil:\\n\\nPemeriksaan tekanan darah, detak jantung, denyut nadi, pemeriksaan pernapasan, kulit, abdomen, leher, kelenjar getah bening, dan refleks saraf dengan hasil normal dan tidak ditemukan tanda/gejala gangguaan kesehatan yang bermakna dan dapat menggangu aktifitas kehidupan sehari-hari.\\n\\n\\nDemikian SURAT KETERANGAN SEHAT JASMANI ini dibuat dengan sebenarnya untuk keperluan pemberkasan _____POLISI_____. Tidak untuk keperluan hukum lainnya.","label":"KETERANGAN MEDIS","type":"textarea"}],"signed":true,"headerDateCreated":"12/12/2022 22:59:21","headerDateOfBirth":"12-06-2002","headerSubtitle":"Yang bertanda tangan dibawah ini:","headerJobGrade":"dr. Umum","headerLastName":"MIRO","headerJobLabel":"EMS","headerFirstName":"X HYTOR","submittable":true}'),
